import React from "react";

class Menu extends React.Component{
    render() {
        return(
            <div>
                <input type="radio" value="nature">Nature</input>
                <input type="radio" value="sky">Sky</input>
                <input type="radio" value="city">City</input>
            </div>
        )
    }
}
export default Menu
